import React, { useState, useEffect } from 'react';

const API_BASE_URL = 'http://localhost:8000';

function Expectations({ sessionId }) {
  const [expectations, setExpectations] = useState([
    {
      id: 'user_management_system',
      title: '用户管理系统',
      description: '一个完整的用户管理系统，提供用户账户生命周期管理和安全访问控制',
      status: 'active',
      createdAt: '2025-04-09 10:30',
      updatedAt: '2025-04-09 14:15'
    },
    {
      id: 'payment_processing',
      title: '支付处理系统',
      description: '安全处理多种支付方式的交易，包括信用卡、电子钱包和银行转账',
      status: 'active',
      createdAt: '2025-04-08 09:15',
      updatedAt: '2025-04-08 16:30'
    },
    {
      id: 'inventory_management',
      title: '库存管理系统',
      description: '跟踪和管理产品库存，支持库存预警和自动补货功能',
      status: 'draft',
      createdAt: '2025-04-07 11:45',
      updatedAt: '2025-04-07 15:20'
    },
    {
      id: 'reporting_dashboard',
      title: '报表仪表板',
      description: '生成和展示业务关键指标的可视化报表和图表',
      status: 'draft',
      createdAt: '2025-04-06 14:30',
      updatedAt: '2025-04-06 17:45'
    }
  ]);

  const [selectedExpectation, setSelectedExpectation] = useState(null);
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedFilter, setSelectedFilter] = useState('all');

  useEffect(() => {
    if (!sessionId) return;

    // 在实际实现中，这里会从后端获取期望列表数据
    const fetchExpectations = async () => {
      try {
        /*
        const response = await fetch(`${API_BASE_URL}/memory/expectations`, {
          headers: {
            'Content-Type': 'application/json',
            'Session-ID': sessionId
          }
        });

        if (response.ok) {
          const data = await response.json();
          setExpectations(data);
          if (data.length > 0) {
            setSelectedExpectation(data[0]);
          }
        }
        */

        // 模拟设置选中的期望
        setSelectedExpectation(expectations[0]);
      } catch (error) {
        console.error('Error fetching expectations:', error);
      }
    };

    fetchExpectations();
  }, [sessionId]);

  const handleExpectationClick = (expectation) => {
    setSelectedExpectation(expectation);
  };

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleCreateExpectation = () => {
    // 处理创建新期望的逻辑
    console.log('Create new expectation');
  };

  const handleEditExpectation = () => {
    // 处理编辑期望的逻辑
    console.log('Edit expectation:', selectedExpectation?.id);
  };

  const handleGenerateCode = () => {
    // 处理生成代码的逻辑
    console.log('Generate code for expectation:', selectedExpectation?.id);
  };

  const filteredExpectations = expectations.filter(exp => {
    const matchesSearch = exp.title.toLowerCase().includes(searchQuery.toLowerCase()) || 
                         exp.description.toLowerCase().includes(searchQuery.toLowerCase()) ||
                         exp.id.toLowerCase().includes(searchQuery.toLowerCase());

    if (selectedFilter === 'all') return matchesSearch;
    return matchesSearch && exp.status === selectedFilter;
  });

  // 子期望和约束的模拟数据
  const subExpectations = [
    {
      id: 'user_registration',
      description: '允许新用户注册账户，收集必要信息并创建用户档案',
      criteria: [
        '必须验证电子邮件的有效性',
        '密码必须安全存储（不可明文保存）',
        '注册过程应防止自动化机器人攻击',
        '用户应收到确认注册的通知'
      ]
    },
    {
      id: 'user_authentication',
      description: '验证用户身份，允许合法用户登录系统',
      criteria: [
        '支持用户名/密码登录',
        '支持Google和微信第三方登录',
        '应限制连续失败的登录尝试',
        '应记录登录活动以便安全审计',
        '成功登录后提供访问令牌'
      ]
    },
    {
      id: 'profile_management',
      description: '允许用户查看和更新个人资料信息',
      criteria: [
        '用户应能修改基本个人信息',
        '敏感操作应要求重新验证身份',
        '应记录个人资料的更改历史'
      ]
    },
    {
      id: 'role_based_access',
      description: '实现基于角色的访问控制',
      criteria: [
        '支持至少三种角色：管理员、普通用户和访客',
        '管理员可以管理所有用户账户',
        '普通用户只能管理自己的资料',
        '访客只有有限的查看权限'
      ]
    }
  ];

  const constraints = [
    '所有用户数据处理必须符合数据保护规范',
    '系统应支持至少10,000个并发用户',
    '身份验证响应时间应小于500毫秒'
  ];

  return (
    <div className="expectations-container">
      <div className="expectation-list">
        <div className="card">
          <div className="card-header">
            <h3 className="card-title">期望列表</h3>
            <div className="search-container">
              <input 
                type="text" 
                placeholder="搜索期望..." 
                className="search-input"
                value={searchQuery}
                onChange={handleSearchChange}
              />
              <span className="material-symbols-rounded search-icon">search</span>
            </div>
          </div>
          <div className="card-content">
            {filteredExpectations.map(exp => (
              <div 
                key={exp.id} 
                className="expectation-item"
                onClick={() => handleExpectationClick(exp)}
                style={{ cursor: 'pointer' }}
              >
                <div className="expectation-header">
                  <span className="expectation-id">{exp.id}</span>
                  <span className={`expectation-status ${exp.status}`}>
                    {exp.status === 'active' ? '活跃' : '草稿'}
                  </span>
                </div>
                <h4 className="expectation-title">{exp.title}</h4>
                <p className="expectation-description">{exp.description}</p>
              </div>
            ))}
          </div>
        </div>
      </div>

      {selectedExpectation && (
        <div className="expectation-detail">
          <div className="expectation-detail-header">
            <h3 className="expectation-detail-title">{selectedExpectation.title}</h3>
            <div className="expectation-detail-actions">
              <button className="secondary-button" onClick={handleEditExpectation}>
                <span className="material-symbols-rounded">edit</span>
                <span>编辑</span>
              </button>
              <button className="primary-button" onClick={handleGenerateCode}>
                <span className="material-symbols-rounded">code</span>
                <span>生成代码</span>
              </button>
            </div>
          </div>

          <div className="expectation-section">
            <h3>基本信息</h3>
            <div className="expectation-property">
              <div className="expectation-property-label">ID</div>
              <div className="expectation-property-value">{selectedExpectation.id}</div>
            </div>
            <div className="expectation-property">
              <div className="expectation-property-label">状态</div>
              <div className="expectation-property-value">
                {selectedExpectation.status === 'active' ? '活跃' : '草稿'}
              </div>
            </div>
            <div className="expectation-property">
              <div className="expectation-property-label">创建时间</div>
              <div className="expectation-property-value">{selectedExpectation.createdAt}</div>
            </div>
            <div className="expectation-property">
              <div className="expectation-property-label">最后更新</div>
              <div className="expectation-property-value">{selectedExpectation.updatedAt}</div>
            </div>
          </div>

          <div className="expectation-section">
            <h3>描述</h3>
            <div className="expectation-property">
              <div className="expectation-property-value">
                {selectedExpectation.description}
              </div>
            </div>
          </div>

          <div className="expectation-section">
            <h3>子期望</h3>
            {subExpectations.map((subExp, index) => (
              <div key={index} className="sub-expectation">
                <p><strong>ID:</strong> {subExp.id}</p>
                <p><strong>描述:</strong> {subExp.description}</p>
                <div className="criteria-list">
                  <p><strong>标准:</strong></p>
                  <ul>
                    {subExp.criteria.map((criteria, critIndex) => (
                      <li key={critIndex}>{criteria}</li>
                    ))}
                  </ul>
                </div>
              </div>
            ))}
          </div>

          <div className="expectation-section">
            <h3>约束条件</h3>
            <div className="expectation-property">
              <div className="expectation-property-value">
                <ul>
                  {constraints.map((constraint, index) => (
                    <li key={index}>{constraint}</li>
                  ))}
                </ul>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Expectations;
